import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
    return (
<div className="navLink" >
                    <NavLink
                        exact
                        to="/"

                        style={linkStyles}
                        activeStyle={{
                            background: "white",}}
                    >
                        Home
                    </NavLink>

                    <NavLink
                        exact to="/about"
                        className="submit ui teal button"
                        style={linkStyles}
                        activeStyle={{
                            background: "white",}}

                    >
                        About Kevin 
                    </NavLink>

                    <NavLink
                        exact to="/projects"
                        id="shorty"
                        activeStyle={{
                            background: "white",textOverflow: "clip"}}
                    >
                        Projects
                    </NavLink>


                    <NavLink
                        exact to="/experience"
                        activeStyle={{
                            background: "white",}}

                    >
                        Experience
                    </NavLink>


                </div>




);
}

export default Header;
